import React ,{ useState }from "react";

const Card = ({ names }) => {

  const [selected , setSelect] =  useState(false);

  
  return (
    <div>
      <div className="cardWrraper">
        {names.map(({ name, Age, addrress, Phone }, index) => (
          <div className="card" key={index}>
            <p>{`Name : ${name}`}</p>
            <p>{`Age : ${Age}`}</p>
            <p>{`addrress : ${addrress}`}</p>
            <p>{`Phone : ${Phone}`}</p>
            fas fa-circle-check
            <button className="selectBtn" onClick={() => setSelect(true)}>
              <i className={selected ? "" : "far fa-circle"}></i>
            </button>
          </div>
        ))}
      </div>

    </div>
  );
};

export default Card;
